import React from "react";


const CenteredContainer = props => {
    return (
        <div class="container">
            <div class="row">
                <div class="col-sm">
                    One of three columns
                </div>
                <div class="col-sm">
                    One of three columns
                </div>
            </div>
        </div>
    );
};

export default CenteredContainer;
